import{_ as a,o as i,c as l,b as e}from"./chunks/framework.6c3c27db.js";const t="/assets/9LGzA2WC2PY.0f57343e.jpg",r="/assets/26.a51fafcb.webp",o="/assets/IMG_0517.20b4b8ed.webp",s="/assets/Tw8MsCllSsc.5c82548b.jpg",P=JSON.parse('{"title":"Антарес","description":"ЦМИТ","frontmatter":{"title":"Антарес","description":"ЦМИТ","date":"2018-07-18","icon":"Logo_big3.png","cover":"cover.jpg","tel":"+7 (495) 249-14-36","instagram":"antareslabmsk","vk":"cmit_antares","email":"info+tecai@antareslab.ru","url":"http://www.antareslab.ru","city":"г. Москва","address":"Хорошевское шоссе 38а","place":"м. Беговая","hours":"пн-пт 10.00 - 19.00","coord":[55.777239803790785,37.53910492769233],"status":"open"},"headers":[],"relativePath":"workshop/catalog/antares/index.md","filePath":"workshop/catalog/antares/index.md"}'),n={name:"workshop/catalog/antares/index.md"},c=e('<p><strong>ЦМИТ &quot;Антарес&quot; — это сообщество ученых, инженеров, разработчиков, педагогов-наставников.</strong></p><p><strong>Наша миссия – популяризация инженерного дела для широкой аудитории и предоставление технических возможностей для воплощения самых невероятных идей.</strong></p><p>Мы нацелены на создание детско-взрослой среды, обучающей решению актуальных проблем с применением научно-технологических разработок. Для этого мы создали высокотехнологичный ресурсный центр, открытый для школьников, студентов, специалистов.</p><p>Мы выстраиваем образовательную и производственную сетевую инфраструктуру совместно с партнерскими ВУЗами, предприятиями, академическими организациями России и образовательными организациями Москвы, чтобы у наших участников был доступ к необходимым для их проектов ресурсам.</p><h3 id="коворкинг" tabindex="-1">Коворкинг <a class="header-anchor" href="#коворкинг" aria-label="Permalink to &quot;Коворкинг&quot;">​</a></h3><p>Если вы точно знаете, что хотите сделать и даже знаете как, но у вас не хватает инструмента или пространства - мы можем с этим помочь! Если же у вас есть какая-то идея, но нет полного представления, как это реализовать, с этим тоже можно идти к нам!</p><p>Внимание! При использовании столярных станков, пожалуйста, пройдите сначала аттестацию в согласованное заранее время.</p><p><img src="'+t+'" alt=""></p><h4 id="станочныи-парк" tabindex="-1">СТАНОЧНЫЙ ПАРК <a class="header-anchor" href="#станочныи-парк" aria-label="Permalink to &quot;СТАНОЧНЫЙ ПАРК&quot;">​</a></h4><ul><li>Циркулярная пила Metabo BSS611</li><li>Фрезер Dexter Power PC1300RT</li><li>Торцовочная пила Hyundai M1500-210</li><li>Электроточило Томск У4.2</li></ul><h4 id="электроинструмент" tabindex="-1">ЭЛЕКТРОИНСТРУМЕНТ <a class="header-anchor" href="#электроинструмент" aria-label="Permalink to &quot;ЭЛЕКТРОИНСТРУМЕНТ&quot;">​</a></h4><ul><li>Электролобзик BLACK+DECKER KS999E</li><li>Электрорубанок BLACK+DECKER BD750</li><li>Ленточная шлифмашина Интерскол ЛШМ-76/900</li><li>Вибрационная шлифмашина Интерскол эпшм 115/135</li><li>Эксцентриковая шлифмашина BOSCH PEX 300 AE</li><li>Перфоратор Makita DHR241</li><li>Сабельная пила Makita BJR182</li><li>Шуруповерт Makita DDF453/XPH12Z</li><li>Импульсный Шуруповерт Makita LXDT04Z</li><li>Шуруповерт Dexter Power CDT219LD</li><li>Гайковерт Makita BTW251</li><li>Дрель Makita DP2011</li><li>УШМ 125мм Makita 9558HN/DGA504</li><li>Нивелир лазерный BOSCH 2 Basic</li><li>Торцовочная пила BOSCH PCM 7</li><li>Электро отвертка Ryobi premium ERGO-A2</li><li>Гравер Dremel 3000-15</li></ul><h4 id="ручнои-инструмент" tabindex="-1">РУЧНОЙ ИНСТРУМЕНТ <a class="header-anchor" href="#ручнои-инструмент" aria-label="Permalink to &quot;РУЧНОЙ ИНСТРУМЕНТ&quot;">​</a></h4><ul><li>Молоток, киянка</li><li>Набор отверток</li><li>Уголок, угломер</li><li>Линейки, рулетки</li><li>Штангенциркуль</li><li>Набор стамесок</li><li>Рубанок</li><li>Набор рашпилей</li><li>Ручной лобзик, пила</li><li>Шило</li><li>Кусачки, круглогубцы, плоскогубцы</li><li>И многое другое</li></ul><p><img src="'+r+'" alt=""><img src="'+o+'" alt=""></p><hr><h5 id="курсы-для-школьников-и-студентов" tabindex="-1">Курсы для школьников и студентов <a class="header-anchor" href="#курсы-для-школьников-и-студентов" aria-label="Permalink to &quot;Курсы для школьников и студентов&quot;">​</a></h5><p>Курсы и мастер-классы по актуальным технологическим направлениям: ракетостроение, робототехника, технологии цифрового производства, VR, нейросети и многое другое</p><h5 id="учебная-мастерская" tabindex="-1">Учебная мастерская <a class="header-anchor" href="#учебная-мастерская" aria-label="Permalink to &quot;Учебная мастерская&quot;">​</a></h5><p>Мастер-классы по изготовлению изделий из дерева, металла, литью из смолы и пластика и т.д. Разные уровни сложности, для взрослых и детей</p><h5 id="центр-промышленного-дизаина-и-прототипирования" tabindex="-1">Центр промышленного дизайна и прототипирования <a class="header-anchor" href="#центр-промышленного-дизаина-и-прототипирования" aria-label="Permalink to &quot;Центр промышленного дизайна и прототипирования&quot;">​</a></h5><p>Промышленный дизайн, поддержка технологических проектов любого уровня сложности, проектирование, макетирование, отработка технологий производства</p><h5 id="отдел-производства" tabindex="-1">Отдел производства <a class="header-anchor" href="#отдел-производства" aria-label="Permalink to &quot;Отдел производства&quot;">​</a></h5><p>Лазерная резка, ЧПУ-фрезеровка, плазменная резка металла, 3D-печать. Изготавливаем заказы любого объема, от значка до мебели</p><h3 id="что-нужно-для-посещения" tabindex="-1">Что нужно для посещения <a class="header-anchor" href="#что-нужно-для-посещения" aria-label="Permalink to &quot;Что нужно для посещения&quot;">​</a></h3><p>Чтобы принять участие в наших мастер-классах не требуются предварительные навыки, однако мы оцениваем, что некоторые мастер-классы не подходят для детей, в частности те, где предполагается работа с циркулярными станками, или, например, со сваркой. Тем не менее, вы всегда можете придти вдвоем с вашим ребенком и вместе работать над проектом. Перед началом любого мастер-класса проводится инструктаж по работе с электроинструментами и станками, кроме того, вы в любой момент можете обратиться за помощью к мастеру-преподавателю. Мы выстраиваем занятие так, чтобы даже новичок смог получить изделие высокого качества, однако для достижения наилучшего результата от вас потребуется внимательность, и главное - терпение. Мы предоставляем все необходимые инструменты, материалы и детали для мастер-класса, а в некоторых случаях вы сможете выбрать дизайн будущего изделия, например рисунок для нанесения, или цвет отделки. Рекомендуем захватить с собой смену одежды для работы, у нас есть раздевалка, где можно переодеться. Обратите внимание, что любой мастер-класс вы можете приобрести в подарок, в этом случае мы оформим красивый подарочный сертификат!</p><p><img src="'+s+'" alt=""></p>',27),h=[c];function p(d,u,_,m,b,k){return i(),l("div",null,h)}const q=a(n,[["render",p]]);export{P as __pageData,q as default};
